        });
      }

      let activeModal = this.modalService.open(ChooseMaterialImportPrComponent, {
        container: 'body',
        windowClass: 'choose-material-import-pr',
        backdrop: 'static'
      });
      activeModal.componentInstance.ListId = this.listId;
      activeModal.result.then(result => {
